import React, { useState } from 'react';
import { CustomInput, Label } from './styled';
import { useForm } from "react-hook-form";
const Component = ({ label, isRequired, placeholder, type, ...rest }, ref) => {

    return (
        <CustomInput>
            <Label>{label}</Label>
            <input type={type} placeholder={placeholder || ""} isRequired={isRequired} {...rest} />
        </CustomInput>
    );
}

export default Component;
export { Component as CustomInput };
